	"cles/agenti/view/dialog/Report.fragment.xml":'<core:FragmentDefinition xmlns:form="sap.ui.layout.form" xmlns:u="sap.ui.unified"\n    xmlns="sap.m"\n    xmlns:core="sap.ui.core"><Dialog showHeader="true" title="Crea Segnalazione" contentWidth="20%"><content><form:SimpleForm ><RadioButtonGroup ><RadioButton text="Problemi Prodotto" selected="true"/><RadioButton text="Modifica Indirizzo"/><RadioButton text="Incasso"/></RadioButtonGroup></form:SimpleForm><VBox class="sapUiSmallMargin"><Label text="Carica un allegato" design="Bold"/><u:FileUploader width="100%" style="Emphasized"\n                    name="myFileUpload"\n                    uploadUrl="upload/"\n                    value="{/value}"\n                    uploadComplete="handleUploadComplete" /></VBox></content><buttons><Button text="Upload"\n                enabled="{= ${/value} ? true : false }"\n                type="Emphasized"\n                press=".defaultDialogClose" /><Button text="Chiudi"\n                type="Emphasized"\n                press=".defaultDialogClose" /></buttons></Dialog></core:FragmentDefinition>',
